[RAW - Japanese Audio / UNCENSORED / COMPLETE]




This is a historic Japanese style hotel, but after Yuji began to work part-time, everything has gone wrong. First, the young landlady and a waitress fell victims to him. Not being satisfied with them, the next games he aims at are three young married women staying at the hotel.




